import React from 'react'

function MultiButtons() {
  return (
    <div className='multibtn'><button>Growth Marketer</button>
    <button className='btn1'>Podcast Producer</button>
    <button className='btn2'>Writer</button>
    <button className='btn3'>WordPress</button>
    <button className='btn4'>Trello</button>
    <button className='btn5'>MailChimp</button>
    <button className='btn6'>notion.so</button>
    <button>Descript</button>
    </div>
  )
}

export default MultiButtons;
